import { useEffect, useState } from 'react'

const Home = () => {
    const [users, setUsers] = useState(null)
    useEffect(() => {
        const fetchUsers = async () => {
            const res = await fetch('hhtp://localhost:4000/api/users')
            const json = await res.json()

            if (res.ok) setUsers(json)
        }

        fetchUsers()
    }, [])

    return(
        <div className="Home">
            <h2>Home</h2>
        </div>
    )
}

export default Home
